import React from "react";
import "./projcard.css";
import ProjCardData from "./ProjCardData";
import ProjCard from "./ProjCard";
import "./projectwork.css";
import { CardGroup } from "react-bootstrap";

function ProjectWork(props) {
  console.log(props.title);
  return (
    <React.Fragment>
      <div className="container-fluid bg-black">
        <h1 className="text-center text-white p-5 ">PROJECTS</h1>

        <div className="row d-flex flex-wrap">
          {ProjCardData.map((val, ind) => {
            return (
              // <div className="col-md-4 d-flex h-100 flex-grow-1">
                <ProjCard className=" d-flex h-100 flex-grow-1"
                  key={ind}
                  imgsrc={val.imgsrc}
                  title={val.title}
                  url={val.url}
                />
              // </div>
            );
          })}
        </div>
      </div>
    </React.Fragment>
  );
}

export default ProjectWork;
